  true,\n\t\"url\": null,\n\t\"notes\": \"This data set contains information on hearings
  conducted for the Department of Transportation or its modal administrations by administrative
  law judges in accordance with the Administrative Procedure Act APA and/or other
  statutes or regulations.  The data include identifying information for each case,
  including titles, docket numbers, original case numbers, and Federal Docket Management
  System (FDMS) numbers, as well as information about counsel; unrepresented parties;
  assigned judges, attorneys, and interns; filings; and dates of significant events.
  Documents for which public dissemination is not prohibited are available through
  FDMS at http://www.regulations.gov/.\",\n\t\"license_title\": \"U.S. Government
